import { Container } from "@mui/material";
import Slider from "./components/Slider";
import AboutMe from "./components/AboutMe";

export default function Home() {
  return (
    <Container maxWidth="fluid" disableGutters>
      <Slider />

      <AboutMe />
    </Container>
  );
}
